import React from "react";

const YouTube = () => {
  return (
    <div>
      <h2>YouTube</h2>
      <p style={{ color: "white", fontSize: "1.2em", lineHeight: "1.6" }}>
        Welcome to our YouTube channel! We regularly post videos about our
        products, services, and more. Don't forget to subscribe and hit the bell
        icon for notifications!
      </p>
    </div>
  );
};

export default YouTube;
